import logo from '../assets/img/logo.png';
import Arcor from '../assets/img/Brand/Arcor.png';
import Compañia from '../assets/img/Brand/Compañia.png';
import Deubel from '../assets/img/Brand/Deubel.png';
import Luccianos from '../assets/img/Brand/Luccianos.png';
import Sable from '../assets/img/Brand/Sable.png';
import SanIgnacio from '../assets/img/Brand/SanIgnacio.png';
import Soychu from '../assets/img/Brand/Soychu.png';

const Brands = [
  { nombre: "Arcor", logo: Arcor },
  { nombre: "Compañía", logo: Compañia },
  { nombre: "Deubel", logo: Deubel },
  { nombre: "Luccianos", logo: Luccianos },
  { nombre: "Sable", logo: Sable },
  { nombre: "San Ignacio", logo: SanIgnacio },
  { nombre: "Soychu", logo: Soychu },
  { nombre: "La Cumbre", logo: logo }, // si esta es tu marca propia o logo institucional
];

export default Brands;
